    private function parse($car, $modelId, $typeId)
    {

        $data = [
            'status_id' => 1,
            'model_id' => $modelId,
            'type_id' => $typeId,
            'year' => $car->car_year,
            'creator_id' => 1,
            'buyer_id' => null,
            'price' => $car->price,
            'color' => $car->exterior_color->hex,
            'transmission' => $car->transmission === 'Automàtica' ? 1 : 0,
            'motor' => null,
            'traction' => $car->traction,
            'details' => null,
            'horse_power' => $car->horse_power,
            'gas_type' => $car->fuel_type === 'GASOLINA' ? 0 : 1,
            'seats' => $car->passengers,
            'picture_uri' => isset($car->image_url) ? $car->image_url : '',
        ];

        $this->storeCar($data);
    }

    private function storeCar($data)
    {
        Car::create($data);
    }

    private function storeBrand($name, $uri)
    {
        CarBrand::updateOrCreate([
            'name' => $name,
        ], [
            'picture_uri' => $uri,
        ]);

        return CarBrand::where('name', $name)->first();
    }

    private function storeModel($brandId, $name)
    {
        CarModel::updateOrCreate([
            'name' => $name,
        ], [
            'brand_id' => $brandId
        ]);

        return CarModel::where('name', $name)->first();
    }

    private function storeType($name, $uri)
    {
        CarType::updateOrCreate([
            'name' => $name,
        ], [
            'picture_uri' => $uri,
        ]);

        return CarType::where('name', $name)->first();
    }
